import React, { Component } from "react";

class CVInfo extends Component {
    constructor(prop) {
        super(prop);

        this.state = {
            info: {
                firstName: "",
                lastName: "",
                email: "",
                phone: ""
            }
        }
    }

    render() {
        return (
            <div className = "cv-p-info">
                <div className="cv-pinfo">
                    <div>
                        <h3>Name</h3>
                    </div>
                    <div>
                        <p>Email</p>
                    </div>
                    <div>
                        <p>Phone</p>
                    </div>
                </div>
                <div className = "cv-einfo">
                    <div>
                        <h3>University Name</h3>
                    </div>
                    <div>
                        <p>City</p>
                    </div>
                    <div>
                        <p>Geaduation Degree</p>
                    </div>
                    <div>
                        <p>Graduation Year</p>
                    </div>
                </div>
            </div>

        );
    }
}
export default CVInfo
